import { List, ListItem } from "@mui/material";

const User = ({ user }) => {
  console.log("User: ", user);
  return (
    <div>
      <h1>{user.name}</h1>
      <p>added blogs</p>
      <List>
        {user.blogs.map((blog) => (
          <ListItem sx={{ display: "list-item" }}>{blog.title}</ListItem>
        ))}
      </List>
    </div>
  );
};

export default User;
